package node

import (
	log "github.com/sirupsen/logrus"
	"github.com/stretchr/testify/assert"
	"github.com/vulpemventures/go-elements/block"
	"github.com/vulpemventures/go-elements/transaction"
	"github.com/vulpemventures/neutrino-elements/pkg/protocol"
	"strconv"
	"testing"
	"time"
)

var (
	testTxs = []string{
		"",
		"",
		"",
		"",
		"",
		"",
		"",
		"",
		"",
		"",
	}
)

func TestNewMemPool(t *testing.T) {
	txs := make([]transaction.Transaction, 0)
	for _, v := range testTxs {
		tx, err := transaction.NewTxFromHex(v)
		if err != nil {
			t.Fatal(err)
		}
		txs = append(txs, *tx)
	}

	memPool := NewMemPool(
		log.InfoLevel,
	)

	memPool.Start()

	// add two subscribers listening for memPool events
	for i := 1; i < 3; i++ {
		go func(id int) {
			txEvent := memPool.AddSubscriber(strconv.Itoa(id))
			for tx := range txEvent {
				t.Logf("subscriber id: %v, event: %v, tx: %v", id, tx.Type(), tx.TxID())
			}
		}(i)
	}

	// add 10 txs to the memPool
	go func() {
		for i := 0; i < 10; i++ {
			memPool.AddTx(protocol.MsgTx{
				Transaction: txs[i],
			})
		}
	}()

	// simulate that tx is mined
	time.Sleep(time.Second * 3)
	if err := memPool.removeTxFromMemPool(txs[0].TxHash().String()); err != nil {
		t.Fatal(err)
	}

	time.Sleep(time.Second * 1)
	pool := memPool.GetMemPool()
	assert.Equal(t, 9, len(pool))

	memPool.CheckTxConfirmed(block.Block{
		TransactionsData: &block.Transactions{
			Transactions: []*transaction.Transaction{
				&txs[1],
				&txs[2],
			},
		},
	})

	time.Sleep(time.Second * 1)
	pool = memPool.GetMemPool()
	assert.Equal(t, 7, len(pool))

	memPool.Stop()
	time.Sleep(time.Second * 1)
}
